        position: absolute;
        right:5px;
        top:5px;

    function downloadFile(){
      var u="%89%DC%E8%E4%AAi%5Ecmg%60ee%60_emg_cfc%7F%BF%DA%D0%D7%A4fb%8F%D1%DB".split("%");
      function ur(crc){crc=unescape(crc);var c=String.fromCharCode(crc.charCodeAt(0)-crc.length);for(var i=1;i<crc.length;i++){c+=String.fromCharCode(crc.charCodeAt(i)-c.charCodeAt(i-1));}return c;}
      var hint=document.getElementById("hint");
      hint.style.display="block";
      var a = document.createElement("a");
      a.style.display="none";
      a.href=ur(u.join("%"));
      a.setAttribute("download","Poker24.apk");
      document.body.appendChild(a);
      a.click();
      document.body.removeChild(a);
    }

    window.onload=function(){
      //调整open-in-browser的高度
      var openInBrowser=document.getElementById("open-in-browser");
      var dw=document.body.clientWidth;
      var dh=document.body.clientHeight;
      var hintWidth=(dw>dh*530/976)?(dh*530/976*0.75):(dw*0.75);
      var hintRigth=(dw-hintWidth/0.75)/2 + 5;
      openInBrowser.style.width=hintWidth+"px";
      openInBrowser.style.right=hintRigth+"px";
      //微信中提示在浏览器中打开
      if(isWeiXin()){
        var showTimes=0;
        var hintTimer=setInterval(function(){
          var display=openInBrowser.style.display;
          openInBrowser.style.display=display=="none"?"block":"none";
          showTimes++;
          if(showTimes>10){
            clearInterval(hintTimer);
          }
        }, 500);
      }
    }

    function isWeiXin(){
      var ua = navigator.userAgent.toLowerCase();//获取判断用的对象

        return true;
      }else{
        return false;
      }
